(1, 'LIGHT+ BUILDING 2012 FRANKFURT', 'ALMANYA', 'Frankfurt', 'Frankfurt Fuar Alanı', 'Her iki yılda bir', 'ULUSLARARASI AYDINLATMA TEKNOLOJİLERİ,IŞIK SİSTEMLERİ', '<p><span style="font-size: small;">Aydınlatma Teknolojisi, Avize, Aydınlatma Armat&uuml;rleri, Elektrik M&uuml;hendisliği, G&uuml;venlik Sistemleri, Aksesuarlar, Sistem Bileşenleri, Bina Otomasyonu, Net İş, &Ouml;l&ccedil;&uuml;m Sistemleri, Bilgi Teknolojileri, İ&ccedil; İnşaat, Sermaye Malları, Kontrol Ekipmanları, G&uuml;neş Perde, Ek Eğitim, Ara&ccedil;ları, Haberleşme Teknolojisi , Daire Aydınlatma Armat&uuml;rleri, Dış Aydınlatma, Yazılım, Bilgisayar Donanım</span></p>', '<p><span style="font-size: small;">Elektrik M&uuml;hendisliği, Elektronik , Aydınlatma , El Sanatları Ekipmanları</span></p>', '<p><span style="font-size: small;">Messe Frankfurt Exhibition GmbH</span><br /><span style="font-size: small;">Ludwig-Erhard-Anlage 1</span><br /><span style="font-size: small;">60327 Frankfurt/Main</span><br /><span style="font-size: small;">Fon: +49 69 7575-0 &middot; Fax: +49 69 7575-6433&nbsp;</span><br /><span style="font-size: small;"><a href="mailto:info@messefrankfurt.com" shape="rect">info@messefrankfurt.com</a></span><br /><span style="font-size: small;"><a href="http://www.messefrankfurt.com/" shape="rect">www.messefrankfurt.com</a></span></p>\r\n<p><span style="font-size: small;">project team&nbsp;</span><br /><span style="font-size: small;">Fon: 069-7575-5850</span><br /><span style="font-size: small;">Fax: 069-7575-6750</span><br /><span style="font-size: small;"><a href="mailto:light+building@messefrankfurt.com" shape="rect">light+building@messefrankfurt.com</a></span><br /><span style="font-size: small;"><a href="http://www.light-building.messefrankfurt.com/" shape="rect">www.light-building.messefrankfurt.com</a></span></p>', '<p><span style="font-size: small;">&bull;&nbsp;Belirtilen havayolu ile gidiş d&ouml;n&uuml;ş u&ccedil;ak bileti</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;Courtyard Marriott Otelde oda kahvaltı konaklama</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;Havalimanı vergileri</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;Havalimanı - hotel - havalimanı transferleri</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;30.000 Euro kapsamlı yurtdışı seyahat sigortası</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;Alman GSM hattı</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;Yurtdışı &ccedil;ıkış fonu har&ccedil; pulu</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;1618 sayılı T&Uuml;RSAB seyahat sigortası g&uuml;vence paketi</span><br /><span style="font-size: small;">&nbsp;&bull;&nbsp;ITF TUR rehberlik hizmetler</span></p>', '<p><span style="font-size: small;">*&Ouml;ğle, akşam yemekleri ve &ouml;zel harcamalar</span><br /><span style="font-size: small;">*Fuar giriş bileti</span><br /><span style="font-size: small;">*Vize &uuml;creti</span></p>', '5 Gece 6 Gün', '6 Gece 7 Gün', '7 Gece 8 Gün', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2000', '15.04.2012', '20.04.2012', '09:00-18:00', '15.04.2012', 'Istanbul Atatürk - Frankfurt', 'TK 1591', '12:00', '14:10', '20.04.2012', 'Frankfurt - Istanbul Atatürk', 'TK 1594', '18:00', '22:00', '14.04.2012', 'Istanbul Atatürk - Frankfurt', 'TK 1593', '14:55', '17:05', '20.04.2012', 'Frankfurt - Istanbul Atatürk', 'TK 1594', '18:00', '22:00', '14.04.2012', 'Istanbul Atatürk - Frankfurt', 'TK 1593', '14:55', '17:05', '21.04.2012', 'Frankfurt - Istanbul Atatürk', 'TK 1594', '15:10', '19:05', 'fba4ba5478461c772ca0972805ee3f36.jpg', 'light-building-2012-frankfurt.html');
